import React , {Component} from 'react';
import Slider from './components/Slider';
import Navbar from './components/Navbar';
import Home from './components/Home';

import './App.css';
import DetailsProduit from './components/DetailsProduit';
import SeConnecter from './components/SeConnecter';
import Sinscrire from './components/Sinscrire';
import Footer from './components/Footer';
import Reparation from './components/Reparation';
import Intervention from './components/Intervention';
import {
  BrowserRouter as Router,
  Switch,
  Route
} from "react-router-dom";
import Panier from './components/Panier';


function App () {
  const user = localStorage.getItem("user")
  const token = localStorage.getItem("token")
    return (
      <Router >
      <div> <Navbar user={user}/>
    <Slider />
    <section>
    <div class="container">
        <div class="row" style={{textAlign: "center"}}>


    <Switch>
    <Route exact path="/">
            <Home />
          </Route>
          <Route exact path="/Sinscrire">
            <Sinscrire />
          </Route>
          <Route exact path="/Reparation">
            <Reparation />
          </Route>
          <Route exact path="/Intervention">
            <Intervention />
          </Route>
          <Route exact path="/SeConnecter">
            <SeConnecter />
          </Route>
          <Route path="/Panier">
            <Panier />
          </Route>
          <Route path="*">
            <Home />
          </Route>
        </Switch>

   </div>
   </div>
   </section>
   <Footer />
         </div>

         </Router> );

}

export default App;
